import { POST_USER_INFO } from './actions';
import axios from 'axios';

export const postUserInfo = (username, email, password, e) => dispatch => {
    e.preventDefault();
        return axios.get('http://127.0.0.1:8000/api/user/' + 'vakttus')
            .then(res => dispatch ({
                type: POST_USER_INFO,
                res: res
            }))
}
